import React, { useContext } from "react";
import {StateHandler} from '../../../StateHandler'

const Cart = () => {
  const state = useContext(StateHandler)
  const [cart] = state.userApi.cart

  if(cart.length === 0) {
    return (
      <h2>Cart is empty</h2>
    )
  }
  return <div>Cart</div>;
};

export default Cart;
